import React, { useState, useEffect } from 'react';
import api from '@landinghub/api';

const UserDashboard = () => {
    const [pages, setPages] = useState([]);
    const [leads, setLeads] = useState([]);
    const [reports, setReports] = useState({});
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        const fetchData = async () => {
            try {
                const pagesRes = await api.get('/api/pages');
                const leadsRes = await api.get('/api/leads');
                const reportsRes = await api.get('/api/reports');
                setPages(pagesRes.data);
                setLeads(leadsRes.data);
                setReports(reportsRes.data);
            } catch (err) {
                console.error('Error fetching user data:', err);
            } finally {
                setLoading(false);
            }
        };
        fetchData();
    }, []);

    if (loading) return <div>Đang tải...</div>;

    return (
        <div className="user-dashboard">
            <h1>User Dashboard</h1>
            <section>
                <h2>Quản lý Landing Page</h2>
                <table>
                    <thead>
                    <tr>
                        <th>Title</th>
                        <th>Status</th>
                        <th>Actions</th>
                    </tr>
                    </thead>
                    <tbody>
                    {pages.map((page) => (
                        <tr key={page._id}>
                            <td>{page.title}</td>
                            <td>{page.status || 'Chưa triển khai'}</td>
                            <td>
                                <button onClick={() => alert(`Xem trước ${page.title}`)}>Xem trước</button>
                                <button onClick={() => alert(`Triển khai ${page.title}`)}>Triển khai</button>
                            </td>
                        </tr>
                    ))}
                    </tbody>
                </table>
                <button onClick={() => alert('Tạo Landing Page mới')}>Tạo mới</button>
            </section>
            <section>
                <h2>Quản lý Leads</h2>
                <table>
                    <thead>
                    <tr>
                        <th>Email</th>
                        <th>Phone</th>
                        <th>Source</th>
                    </tr>
                    </thead>
                    <tbody>
                    {leads.map((lead) => (
                        <tr key={lead._id}>
                            <td>{lead.email}</td>
                            <td>{lead.phone}</td>
                            <td>{lead.source}</td>
                        </tr>
                    ))}
                    </tbody>
                </table>
            </section>
            <section>
                <h2>Báo cáo</h2>
                <p>View Count: {reports.view_count || 0}</p>
                <p>Lead Count: {reports.lead_count || 0}</p>
                <button onClick={() => alert('Xuất báo cáo')}>Export</button>
            </section>
            <section>
                <h2>Thanh toán & Premium</h2>
                <p>Gói hiện tại: Free</p>
                <button onClick={() => alert('Nâng cấp Premium')}>Nâng cấp Premium</button>
            </section>
            <section>
                <h2>Quảng cáo & Marketing</h2>
                <form
                    onSubmit={(e) => {
                        e.preventDefault();
                        alert('Email gửi thành công');
                    }}
                >
                    <input type="text" placeholder="Subject" />
                    <textarea placeholder="Content" />
                    <button type="submit">Gửi Email</button>
                </form>
            </section>
            <section>
                <h2>Tương tác Khách hàng</h2>
                <button onClick={() => alert('Quản lý Chatbot')}>Quản lý Chatbot</button>
            </section>
        </div>
    );
};

export default React.memo(UserDashboard);
